// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./GameContract.sol";

contract CompetitionContract {
    mapping(address => GameContract) GameContractAdressesToGameContract;

    struct Competition {
        string name;
        address[] gamesAddresses;
        address admin;
    }

    Competition competition;

    event NewGameContract(GameContract);

    constructor(string memory _name, address _admin) {
        competition = Competition({
            admin: _admin,
            name: _name,
            gamesAddresses: new address[](0)
        });
    }

    function getGamesAdresses()
        external
        view
        isAdmin()
        returns (address[] memory)
    {
        return competition.gamesAddresses;
    }

    function getName() external view isAdmin() returns (string memory) {
        return competition.name;
    }

    function getAdmin() public view returns (address) {
        return competition.admin;
    }

    function getCompetition()
        external
        view
        returns (
            address admin,
            string memory name,
            address[] memory gameAdresses
        )
    {
        return (
            competition.admin,
            competition.name,
            competition.gamesAddresses
        );
    }

    function createGame(
        string calldata teamAName,
        string calldata teamBName,
        string calldata description,
        string calldata cover,
        uint256 _start
    ) external isAdmin() {
        address currentAdmin = getAdmin();
        GameContract newGameContract = new GameContract(
            teamAName,
            teamBName,
            description,
            _start,
            currentAdmin,
            cover
        );
        competition.gamesAddresses.push(address(newGameContract));
        emit NewGameContract(newGameContract);
    }

    modifier isAdmin() {
        require(
            msg.sender == competition.admin,
            "You need admin rights to perform this action"
        );
        _;
    }
}
